$(function() {

    $("input,textarea").jqBootstrapValidation({
        preventSubmit: true,
        submitError: function($form, event, errors) 
        {
            alert("Prescription Generation Failed")
        },
        submitSuccess: function($form, event) {
            event.preventDefault(); 

            // get values from FORM
            var date = $("input#date").val();
            var docname = $("input#docname").val();
            var patname = $("input#patname").val();
            var sympt = $("input#symp").val();
            var suggest = $("input#sugg").val();
            var medic = $("input#med").val();

            var firstName = docname; // For Success/Failure Message
            // Check for white space in name for Success/Fail message
            if (firstName.indexOf(' ') >= 0) {
                firstName = docname.split(' ').slice(0, -1).join(' ');
            }

          var doc = new jsPDF();
       		 var imgData = 'data:image/jpeg;base64,'
       		doc.addImage(imgData, 'JPEG',0,0,210,297);


          var datelabel = "Date of Appointment : ";
          var docnamelabel = "Doctor Name : ";
          var patnamelabel = "Patient Name : ";
          var symptlabel = "Symptoms (if any): ";
          var suggestlabel = "Test Suggestions (if any): ";
          var mediclabel = "Medicines Prescribed (if any): ";

          var firstlabel = "Details";
          var secondlabel = "Medications and Suggestions";

          var date = $("input#date").val();
          var docname = $("input#docname").val();
          var patname = $("input#patname").val();
          var sympt = $("input#symp").val();
          var suggest = $("input#sugg").val();
          var medic = $("input#med").val();
        

       		doc.setFontSize(14);
          doc.setFontType("bold");
       		doc.setTextColor(0, 0, 0);



          doc.text(90, 60, firstlabel);

          doc.text(50, 80, datelabel);
       		doc.text(120, 80, date);
          doc.text(50, 90, docnamelabel);
       		doc.text(120, 90, docname);
          doc.text(50, 100, patnamelabel);
       		doc.text(120, 100, patname);
          doc.text(50, 110, symptlabel);
       		doc.text(120, 110, sympt);


          doc.text(70, 130, secondlabel);
          doc.text(50, 150, suggestlabel);
          doc.text(120, 150, suggest);
          doc.text(50, 160, mediclabel);
          doc.text(125, 160, medic);

          doc.save('Prescription.pdf');
        },

        filter: function() {
            return $(this).is(":visible");
        },
    });

    $("a[data-toggle=\"tab\"]").click(function(e) {
        e.preventDefault();
        $(this).tab("show");
    });
});
